import womanVrTopData from '../mockData/womanVrTopData';

const WomanVR = () => {
  return (
    <section className="woman__vr">
      <div className="woman__vr-left">
        <img src={womanVrTopData.imageSrc} alt={womanVrTopData.altText} />
      </div>
      <div className="woman__vr-right">
        <h2 className="cont2">{womanVrTopData.title}</h2>
        <p className="cont3">{womanVrTopData.description}</p>
        <a href="#" className="cont1">{womanVrTopData.buttonText}</a>
      </div>
    </section>
  );
};

export default WomanVR;
